import ListItem from './ListItem';

const ListResults = (props) => {
  if (props.items.length === 0) {
    return <h2>Enter a task</h2>;
  } else {
    return (
      <ul>
        {props.items.map((task) => (
          <ListItem
            key={task.id}
            date={task.date}
            title={task.ttile}
            description={task.description}
          />
        ))}
      </ul>
    );
  }
};
export default ListResults;
